import React, {Component} from "react";

class TrainersSection extends Component {
    render () {
        return (
            <div className = "trainersSection">
                <div className = "stacyImage">
                </div>
                <div className = "stacyInfo">
                    <p>sup</p>
                </div>

                <style jsx>{`
                    .trainersSection {
                        font-family: Lato;                    
                    }

                    .trainersSection .shoutout {
                        font-weight: 700;
                        padding-left: 20px;
                        font-size: 20px;
                    }

                    .trainersSection p {
                        padding-left: 20px;
                    }

                    .trainersSection .stacyImage {
                        width: 50%;
                        background-image: url("http://drive.google.com/uc?export=view&id=1Y2H2DV__ISTvHG-pyIq9xWsUoQAJrWrE");
                        height: 100vh;
                        background-size: cover;
                        display: inline-block;
                    }

                    .trainersSection .stacyInfo {
                        width: 50%;
                    }
                `}</style>
            </div>
        );
    }
}

export default TrainersSection;
